import React from 'react';
import Login from '../Login';
import {Container} from '../Login/loginStyle'





const LogIn = ()=>{
    console.log("Log in rendered")
    return(
        <Container>
            
            <Login/>

            <div>
                <form onSubmit>
                    <input type='email' name='Email' placeholder='Email/Phone Number' required onChange/>
                    <input type='password' name='Password' placeholder='Password' required onChange/>
                    <button onSubmit></button>>
                </form>

            </div>

        </Container>

       
    );
};
export default LogIn;
